met Alison Lohman, Justin Long en Lorna Raver

Christine Brown (Alison Lohman) is een ambitieuze bank-employee met een prima leventje. Op een dag echter verschijnt de 
mysterieuze vrouw Mrs. Ganush (Lorna Raver) aan het bankloket om een toeslag op haar huur te bewerkstelligen. Moet Christine 
toegeven aan deze bedelaarsactie of de ambities van haar baas laten prevaleren? Christine kiest voor het laatste waardoor Mrs. 
Ganusch het huis uit wordt gezet. Omgekeerd plaatst de oude vrouw de machtige vloek van de Lamia op Christine, en transformeert 
haar leven in een hel. Noodgedwongen zoekt zij de hulp van helderziende Rham Jas (Dileep Rao) om haar ziel van eeuwige 
verdoemenis te redden.
